def plotGraph(data, title, fname, isBatchGraph):
    x = range(1, len(data) + 1)
    if isBatchGraph:
        plt.xlabel('Batch Number')
    else:
        plt.xlabel('Epoch Number')
    plt.title(title)
    plt.plot(x, data)
    plt.savefig('./graphs/' + fname + '.png')
    plt.clf()
    plt.cla()
    plt.close()

